import { Link } from 'react-router-dom';
import './Nav.scss';

const Nav = () => {
  return (
    <div className="nav-div">
      <Link className='nav-link' to='/'>
        <h1 className="nav-title">Resume Rater</h1>
        <h3 className="nav-subtitle">By Tech Start UCalgary Team</h3>
      </Link>
    </div>
  );
};

export default Nav;
